import React from 'react';

const Dashboard = ({photos}) => {

  let photoEls =  photos.map(photo => {
    return <div className="photo-wrapper">
      {photo}
    </div>;
  })
  return (
    <div className="dashboard-wrapper">
      DASHBOARD
    </div>
  )
}

export default Dashboard;
